import styled from "styled-components";

import { Course } from "../../types";

const TableWrapper = styled.div`
    background: #FFFFFF;
    border-radius: 8px;
    padding: 40px;

        table {
            border-collapse: collapse;
          }

          th {
            border-bottom: 1pt solid #292C3E;
          }

`;

export const CourseTable: React.FC<{ coursesList: Course[] }> = ({ coursesList }) => {
    return (
        <TableWrapper>
<table>
            <thead>
                <tr>
                    <th>Course</th>
                    <th>Category</th>
                    <th>ID</th>
                    <th>Price</th>
                    <th>Location</th>
                    <th>Dates</th>
                    <th>Link</th>
                </tr>
            </thead>
            <tbody>
                {coursesList.map(item => {
                    return (
                        <tr key={item.id}>
                            <td>{item.course_id}</td>
                            <td>{item.category}</td>
                            <td>{item.id}</td>
                            <td>{item.price}</td>
                            <td>{item.location}</td>
                            <td>{`${item.starts_at} - ${item.ends_at}`}</td>
                            <td>Register</td>
                        </tr>
                    );
                })}
            </tbody>
        </table>
        </TableWrapper>
    )
}
